          {!isEmpty(vitalsData) &&
            Object.keys(vitalsData).map((key) => (
              <div className="d-flex vital-item">
                <div className="vital-lhs">{key}</div>
                <div className="me-3">:</div>
                <div className="vital-rhs">{vitalsData[key] ? vitalsData[key] : '-' }</div>
              </div>
            ))}
        </div>
      </div>
    );
}
